// easiest sort to implement but worse to use with real large data sets

function swap(arr, i, j) {
    var temp = arr[i];
    arr[i] = arr[j];
    arr[j] = temp;
}

function bubblesort(arr) {
    var swaps = 0;
    for (var i = 1; i < arr.length; i++) {
        if (arr[i-1] > arr[i]) {
            swap(arr, i-1, i);
            swaps++;
        }
    }
    if (swaps > 0)
        return bubblesort(arr);
    
    return arr;
}

